import style from './welcome.module.css';

const Welcome = (props) => {
const {name, age} = props;
return(
    <>
    <h1>Bonjour</h1>
    <h2 className={style.name}>{name}</h2>
    <p>age : {age}</p>
    </>
)

}

export default Welcome;
